webpackJsonp([43415470123144],{1162:function(A,a){A.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/flash-camp-birmingham/index.md absPath of file >>> MarkdownRemark",html:'<p>[\n  <a\n    class="gatsby-resp-image-link"\n    href="/portfolio-2018/static/flashcampbirmingham-93b643569a842fcb9c8a8bda8fd90a46-e8574.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.99999999999999%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Flash Camp - Birmingham"\n        title=""\n        src="/portfolio-2018/static/flashcampbirmingham-93b643569a842fcb9c8a8bda8fd90a46-e8574.jpg"\n        srcset="/portfolio-2018/static/flashcampbirmingham-93b643569a842fcb9c8a8bda8fd90a46-c94d9.jpg 158w,\n/portfolio-2018/static/flashcampbirmingham-93b643569a842fcb9c8a8bda8fd90a46-9885b.jpg 315w,\n/portfolio-2018/static/flashcampbirmingham-93b643569a842fcb9c8a8bda8fd90a46-e8574.jpg 500w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p><strong>Flash Camp Birmingham</strong> is now open for registrations - it\'s on June 16th (2009), 12pm - 8pm.</p>\n<p>It\'s gonna be great, of course - is organised by the <a href="http://flashmidlands.com/">Flash Midlands user group</a>, and is the first FlashCamp to take place in the UK outside of London.  Luckily for all who are used to everything taking place in London, Birmingham is only a single train ride from London. ;-)</p>\n<p>There\'s quite a few interesting presentations arranged for the day: <a href="http://flashcamp.co.uk/schedule.html">http://flashcamp.co.uk/schedule.html</a> and plenty of information on how to get there: <a href="http://flashcamp.co.uk/venue.html">http://flashcamp.co.uk/venue.html</a></p>\n<p>Head on over to the website to register, and turn up on the day! (It\'s free!)</p>',frontmatter:{title:"Flash Camp Birmingham",date:"May 07, 2009",tags:["flash"],url:null}}},pathContext:{prev:{frontmatter:{path:"/blog/flash-on-the-beach-08/",tags:["flash","conferences"],title:"Flash on the Beach '08",image:null,date:"2008-04-21T13:00:54.000Z"}},next:{frontmatter:{path:"/blog/fixed-mx-accessibilitylabelaccimpl-could-not-be-found/",tags:["flex","air","problems"],title:"Fixed: mx.accessibility:LabelAccImpl could not be found.",image:null,date:"2010-06-21T21:47:21.000Z"}}}}}});
